import Image from 'next/image';
import { SlideStyles } from './SlideStyles';

export default function Slide({mediaByIndex, index}) {
  return (
    <SlideStyles>
      <div className='product-item'>
        <Image
          className='product-image'
          src={mediaByIndex(index)}
          width={300}
          height={300}
          layout='responsive'
        />
      </div>
    </SlideStyles>
  );
}
